var UserCRUDService=angular.module("UserCRUDService",[]);UserCRUDService.service("UserCRUDService",["$http",function(a){this.getUser=function(b){return a({method:"GET",url:"users/"+b})},this.addUser=function(b,c){return a({method:"POST",url:"users",data:{name:b,email:c}})},this.deleteUser=function(b){return a({method:"DELETE",url:"users/"+b})},this.editarUser=function(b,c,d){return a({method:"PATCH",url:"users/"+b,data:{name:c,email:d}})},this.getAllUsers=function(){return a({method:"GET",url:"users"})}}]);